mapper.select:
select

from
    ns_core_funcinfo
where
    1=1

     and ENTERPRISE_ID = #{enterpriseId}


     and ORGANIZATION_ID = #{organizationId}


     and JE_CORE_FUNCINFO_ID = #{funcId}

select

from
    ns_core_funcinfo
where
    1=1

     and ENTERPRISE_ID = #{enterpriseId}


     and ORGANIZATION_ID = #{organizationId}


     and JE_CORE_FUNCINFO_ID = #{jeCoreFuncinfoId}

select
from ns_core_funcinfo where 1=1
and ENTERPRISE_ID = #{enterpriseId}
and ORGANIZATION_ID = #{organizationId}
order by SY_ORDERINDEX ASC

mapper.delete:
delete from ns_core_funcinfo 
where
    enterprise_id = #{enterpriseId}
and organization_id = #{organizationId}

mapper.update:
update set ns_core_funcinfo
del_status = 1,
update_user_id = #{ updateUserId, jdbcType=BIGINT },
update_time = #{updateTime, jdbcType=TIMESTAMP }
where
	ID = #{id}
